import React from 'react';
//import { images } from '../../constants/images';
import './Navbar.scss';

import logo from '../../img/EDEV.svg'

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src={logo} alt="logo" />
      </div>
    </nav>
  );
}

export default Navbar;
